import React from "react";
import { Typography } from "@material-ui/core";
import { Container, Row, Col, Button, ButtonGroup } from "react-bootstrap";
import ChevronRightIcon from '@material-ui/icons/ChevronRight';

export function TopBanner(){
    return(
        <Container fluid>
            <Row className="justify-content-center">
                <Col xs lg="6">
                    <Typography >Financia el sueño de tu empresa</Typography>
                    <Typography>Nuestro modelo de riesgos evalúa en segundos una operación, lo que nos permite financiar en el mismo día.</Typography>
                    
                    <ButtonGroup className="me-2" aria-label="Second group">
                        <Button>Empieza a financiarte</Button> <Button> > </Button> 
                    </ButtonGroup>
                </Col>
                <Col lg="6">
                </Col>
            </Row>
        </Container>
    )
}
